  false,\n\t\"url\": null,\n\t\"notes\": \"Completion report for a study of muskrat
  population dynamics and vegetation utilization, being led by Utah State University
  for a doctorate dissertation. The study objectives are as follows: (1) Estimate
  population parameters for the muskrats in the study area (i.e. size, fecundity,
  and age and sex structure), (2) Determine and evaluate the degree of utilization
  of the marsh vegetation by a known population of muskrats, and (3) Provide a management
  plan for muskrats and marsh habitat based on population and utilization parameters.
  \ In 1980 a commercial trapping program for muskrats (Ondatra zibethicus) was instituted
  on the Fish Springs National Wildlife Refuge. The \"Muskrat Inventory Procedure
  No. 911 for Fish Springs charges the refuge personnel with the responsibility of
  determining the population status of the muskrat population in order to properly
  manage the harvest. Because a consistent and reliable index of the muskrat density
  is necessary for determining trapping quotas, 4 indexing techniques were employed
  during September 1981 in an attempt to ascertain which was the most efficient and
  accurate method. In addition to evaluating the procedures, the simultaneous implementation
  of the techniques provided an opportunity to more reliably estimate the muskrat
  population status for the 1981 trapping season. Both direct and indirect methods
  were utilized to determine density. Four management units on the refuge were used
  for collecting the data: 1) Harrison, 2) Mallard, 3) Shoveler, and 4) Curlew (Figure
  1). Results determined from these units can be used to extrapolate to the entire
  refuge.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
